import React, { useState, useEffect, useCallback } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { Activity, Terminal, Settings, Info, RefreshCw, Zap } from 'lucide-react';
import GraphComponent from './GraphComponent';
import './App.css';

const POLL_INTERVAL = 3000;

// Sample initial data
const initialData = {
  nodes: [
    { id: 'main', name: 'Cosmo', type: 'main', status: 'running' },
    { id: 'agent-1', name: 'Researcher', type: 'sub-agent', status: 'idle' },
    { id: 'agent-2', name: 'Coder', type: 'sub-agent', status: 'idle' },
  ],
  links: [
    { source: 'main', target: 'agent-1' },
    { source: 'main', target: 'agent-2' },
  ],
};

function App() {
  const [graphData, setGraphData] = useState(initialData);
  const [logs, setLogs] = useState([]);
  const [isConnected, setIsConnected] = useState(true);
  const [lastUpdate, setLastUpdate] = useState(new Date());
  const [showPanel, setShowPanel] = useState(true);
  const [activeAgents, setActiveAgents] = useState(1);
  const [activeTools, setActiveTools] = useState(0);

  // Fetch data from gateway
  const fetchGatewayData = useCallback(async () => {
    try {
      // Replace with actual gateway endpoint
      const response = await fetch('http://localhost:3000/api/sessions');

      if (!response.ok) throw new Error('Gateway unavailable');

      const sessions = await response.json();

      // Transform gateway data to graph format
      const nodes = [];
      const links = [];

      // Add main agent
      nodes.push({
        id: 'main',
        name: 'Cosmo',
        type: 'main',
        status: 'running',
      });

      let toolCount = 0;
      let runningAgents = 1;

      sessions.forEach((session) => {
        const sessionId = session.id || session.sessionKey;
        const isActive = session.active || session.status === 'active';

        // Add sub-agent node
        nodes.push({
          id: sessionId,
          name: session.label || session.agentId || `Agent-${sessionId.slice(0, 8)}`,
          type: 'sub-agent',
          status: isActive ? 'running' : 'idle',
        });

        if (isActive) runningAgents++;

        // Link to main
        links.push({
          source: 'main',
          target: sessionId,
          active: isActive,
        });

        // Add tool calls if present
        if (session.tools || session.toolCalls) {
          const tools = session.tools || session.toolCalls || [];
          tools.forEach((tool, idx) => {
            const toolId = `${sessionId}-tool-${idx}`;
            nodes.push({
              id: toolId,
              name: tool.name || tool.function?.name || 'Tool',
              type: 'tool',
              status: 'running',
            });
            links.push({
              source: sessionId,
              target: toolId,
              active: true,
            });
            toolCount++;
          });
        }
      });

      setGraphData({ nodes, links });
      setActiveAgents(runningAgents);
      setActiveTools(toolCount);
      setIsConnected(true);
      setLastUpdate(new Date());

      // Add log entry
      const newLog = {
        id: Date.now(),
        time: new Date().toLocaleTimeString(),
        message: `Synced ${nodes.length} nodes, ${links.length} links`,
        type: 'info',
      };
      setLogs(prev => [newLog, ...prev].slice(0, 50));

    } catch (error) {
      console.log('Gateway fetch failed (using mock):', error.message);
      setIsConnected(false);

      // Simulate dynamic data when gateway unavailable
      simulateMockData();
    }
  }, []);

  // Simulate dynamic data for demo
  const simulateMockData = useCallback(() => {
    setGraphData(prev => {
      const hasToolCall = Math.random() > 0.7;
      const hasToolComplete = Math.random() > 0.8;

      let newNodes = [...prev.nodes];
      let newLinks = [...prev.links];

      // Randomly spawn a tool
      if (hasToolCall && !newNodes.find(n => n.type === 'tool')) {
        const agents = newNodes.filter(n => n.type === 'sub-agent');
        if (agents.length > 0) {
          const targetAgent = agents[Math.floor(Math.random() * agents.length)];
          const toolId = `tool-${Date.now()}`;
          newNodes.push({
            id: toolId,
            name: ['web_search', 'file_read', 'exec', 'browser'][Math.floor(Math.random() * 4)],
            type: 'tool',
            status: 'running',
          });
          newLinks.push({
            source: targetAgent.id,
            target: toolId,
            active: true,
          });
        }
      }

      // Remove completed tools
      if (hasToolComplete) {
        const tools = newNodes.filter(n => n.type === 'tool');
        if (tools.length > 0) {
          const toRemove = tools[0].id;
          newNodes = newNodes.filter(n => n.id !== toRemove);
          newLinks = newLinks.filter(l => 
            (l.source.id || l.source) !== toRemove && 
            (l.target.id || l.target) !== toRemove
          );
        }
      }

      // Update statuses
      newNodes = newNodes.map(n => ({
        ...n,
        status: n.type === 'tool' ? 'running' : Math.random() > 0.5 ? 'running' : 'idle',
      }));

      return { nodes: newNodes, links: newLinks };
    });

    setActiveAgents(graphData.nodes.filter(n => n.status === 'running').length);
    setActiveTools(graphData.nodes.filter(n => n.type === 'tool').length);
    setLastUpdate(new Date());
  }, [graphData]);

  // Poll gateway
  useEffect(() => {
    fetchGatewayData();
    const interval = setInterval(fetchGatewayData, POLL_INTERVAL);
    return () => clearInterval(interval);
  }, [fetchGatewayData]);

  return (
    <div className="app-container">
      {/* Header */}
      <header className="header">
        <div className="header-left">
          <Zap className="logo-icon" size={24} />
          <h1 className="title">COSMO COMMAND</h1>
          <span className={`status-badge ${isConnected ? 'online' : 'offline'}`}>
            {isConnected ? 'ONLINE' : 'OFFLINE'}
          </span>
        </div>
        <div className="header-right">
          <button className="icon-btn" onClick={() => setShowPanel(!showPanel)}>
            <Terminal size={18} />
          </button>
          <button className="icon-btn">
            <Settings size={18} />
          </button>
        </div>
      </header>

      {/* Main Content */}
      <div className="main-content">
        {/* Graph Canvas */}
        <div className="graph-container">
          <GraphComponent data={graphData} />

          {/* Overlay Stats */}
          <div className="stats-overlay">
            <div className="stat-item">
              <Activity size={14} className="stat-icon" />
              <span className="stat-label">AGENTS</span>
              <span className="stat-value cyan">{activeAgents}</span>
            </div>
            <div className="stat-item">
              <RefreshCw size={14} className="stat-icon" />
              <span className="stat-label">TOOLS</span>
              <span className="stat-value amber">{activeTools}</span>
            </div>
          </div>
        </div>

        {/* Side Panel */}
        <AnimatePresence>
          {showPanel && (
            <motion.div
              initial={{ x: 300, opacity: 0 }}
              animate={{ x: 0, opacity: 1 }}
              exit={{ x: 300, opacity: 0 }}
              transition={{ type: 'spring', damping: 25, stiffness: 200 }}
              className="side-panel"
            >
              <div className="panel-header">
                <Terminal size={16} />
                <span>SYSTEM LOGS</span>
                <span className="panel-time">
                  {lastUpdate.toLocaleTimeString()}
                </span>
              </div>

              <div className="logs-container">
                {logs.length === 0 ? (
                  <div className="empty-logs">
                    <Info size={24} className="empty-icon" />
                    <p>Waiting for agent activity...</p>
                  </div>
                ) : (
                  logs.map(log => (
                    <motion.div
                      key={log.id}
                      initial={{ opacity: 0, y: -10 }}
                      animate={{ opacity: 1, y: 0 }}
                      className="log-entry"
                    >
                      <span className="log-time">{log.time}</span>
                      <span className={`log-type ${log.type}`}>‚óè</span>
                      <span className="log-message">{log.message}</span>
                    </motion.div>
                  ))
                )}
              </div>

              <div className="panel-footer">
                <div className="legend">
